import { Link } from 'react-router-dom';

const Navbar = ({ userLogin, AdminLogin, current, User }) => {
  return (
    <nav className="w-full h-[50px] bg-[#4779ae] flex items-center px-4">
      <div className="flex w-full justify-between items-center">

        {/* Left side */}
        <ul className="flex space-x-4">
          {userLogin && (
            <li className="text-white font-bold">
              {current}
              <Link to="/homebutton" className="nav-link text-white font-bold ml-2">
                Home <span className="sr-only">(current)</span>
              </Link>
            </li>
          )}
        </ul>

        {/* Center */}
        {userLogin && (
          <ul className="flex justify-center items-center text-white font-bold">
            <li>
              <h5 className="ml-40">{User.roledesc}</h5>
            </li>
          </ul>
        )}

        {/* Right side */}
        <ul className="flex items-center space-x-4">
          {userLogin && AdminLogin && (
            <li>
              <Link to="/adminhod" className="text-white font-bold" id="usermanagement">
                <h5>Admin</h5>
              </Link>
            </li>
          )}

          {userLogin && (
            <li className="relative group">
              <button className="text-white font-bold focus:outline-none">
                {User.name}
              </button>
              <ul className="absolute right-0 mt-2 w-48 bg-white shadow-lg rounded-md hidden group-hover:block z-10">
                <li>
                  <Link to="/changePass" className="block px-4 py-2 hover:bg-gray-100">
                    Change Password
                  </Link>
                </li>
                <li>
                  <Link to="/logout" className="block px-4 py-2 hover:bg-gray-100">
                    Logout
                  </Link>
                </li>
              </ul>
            </li>
          )}
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
